import React from 'react';
import './App.css';
import HomePage from './pages/HomePage.js';
import CompletePage from './pages/CompletePage.js';
import SetupPage from './pages/SetupPage.js';
import LandingPage from './pages/LandingPage.js';
import {
    BrowserRouter as Router,
    Route,
} from 'react-router-dom';

function App() {
  return (
      <Router>
          <div className="App">
            <div id="page-id">
              <Route path="/" component={HomePage} exact/>
              <Route path="/login/:mail" component={CompletePage} />
              <Route path="/addClasses" component={LandingPage} />
              <Route path="/classroomSetup" component={SetupPage} />
              <Route path="/classroomReady" component={CompletePage} />
            </div>
          </div>
      </Router>
  );
}

export default App;
